import React from "react";

import RequestForm from "./pages/RequestForm";

const App = () => {
  return (
      <Router>
          <Routes>
              <Route path="/request/form" element={< RequestForm/>} />

              <Route path="*" element={<Navigate to="/request/form" />} />
          </Routes>
      </Router>
  );
};

export default App;
